import React from "react";
import GlobalStyle from "../../styles/Global.css";
import AssesStyle from "../../styles/Asses/Asses.css";

const { Container } = GlobalStyle
const { ContainerBidder, ContainerBtns, Btn } = AssesStyle


function Asses() {

    return (
        <Container>
            <ContainerBidder>
            </ContainerBidder>
            <ContainerBtns></ContainerBtns>
            <Btn>
                <img src="https://img.icons8.com/?size=256&id=VFaz7MkjAiu0&format=png" alt="Нравится" srcset="" style={{ width: "50px", height: "50px" }} />
            </Btn>
            <Btn>
                <img src="https://img.icons8.com/?size=256&id=VFaz7MkjAiu0&format=png" alt="Не нравится" srcset="" style={{ width: "50px", height: "50px" }} />
            </Btn>
        </Container>
    )
}

export default Asses
